import React, { Component } from 'react';

class First extends Component {
    constructor(props) {
        super(props);
    }

    timerId

    hi() {
        console.log('da')
    }

    componentDidMount() {
        this.timerId = setInterval(this.hi, 1000)
    }

    componentWillUnmount() {
        clearInterval(this.timerId)
    }

    render() {
        return (
            <div>
                <h1>
                    Ana are mere
                </h1>
                <button>Ok</button>
            </div>
        )
    }
}

export default First;
